    "%matplotlib inline\n",
    "\n",
    "import cv2\n",
    "import pytesseract\n",
    "from matplotlib import pyplot as plt\n",
    "\n",
    "\n",
    "def do_median(func):\n",
    "    img_ori = cv2.imread('../imgs/doc.png')\n",
    "    img_blur1 = func(img_ori, 1)\n",
    "    img_blur3 = func(img_ori, 3)\n",
    "    img_blur5 = func(img_ori, 5)\n",
    "\n",
    "    titles = ['Original Image', 'Blur Image 1', 'Blur Image 3', 'Blur Image 5']\n",
    "    images = [img_ori, img_blur1, img_blur3, img_blur5]\n",
    "\n",
    "    for i, _ in enumerate(images):\n",
    "        plt.subplot(len(images),1,i+1)\n",
    "        plt.imshow(images[i])\n",
    "        plt.title(titles[i])\n",
    "        plt.subplots_adjust(hspace = .6) # add spaces\n",
    "        plt.xticks([]),plt.yticks([])\n",
    "\n",
    "    plt.show()\n",
    "    \n",
    "    for i, img in enumerate(images):\n",
    "        print(f\"---{titles[i]}---\")\n",
    "        print(pytesseract.image_to_string(img, lang=\"jpn\"))\n",
    "        print(\"\\n\")\n",
    "        \n",
    "do_median(cv2.medianBlur)"
